import express from 'express'
let router = express.Router()

/* food-item */
import FoodItem from './food-item/model'
import FoodItemDataAccessObject from './food-item/data-access-object'
/**
 * get: /api/food-item
 * data tr v  dng: 
 * {
 *   food-item-id-1: {
 *     vendorID,
 *     name,
 *     price,
 *     quantity
 *     categories,
 *     description,
 *     photo
 *   },
 *   food-item-id-2: {
 *     vendorID,
 *     name,
 *     price,
 *     quantity
 *     categories,
 *     description,
 *     photo
 *   },
 *   ...
 * }
 */
router.get('/food-item', async (req, res) => {
    res.json(await FoodItemDataAccessObject.query())
})
/**
 * get: /api/food-item/:id
 * :id l id ca food item mun ly thng tin
 * Nu id l trng khp th tr v
 * {
 *   vendorID,
 *   name,
 *   price,
 *   quantity
 *   categories,
 *   description,
 *   photo
 * }
 */
router.get('/food-item/:id', async (req, res) => {
    res.json(await FoodItemDataAccessObject.queryByID(req.params.id))
})
/**
 * post: /api/food-item
 * - header:
 * {
 *   "Content-Type": "application/json"
 * }
 * - data:
 * {
 *   vendorID,
 *   name,
 *   price,
 *   quantity,
 *   categories,
 *   description,
 *   photo
 * }
 * 
 * Thm mn n mi vo database v tr v:
 * {
 *   key
 * }
 * trong  key l id ca mn n mi thm
 */
router.post('/food-item', (req, res) => {
    let vendorID = req.body.vendorID
    let name = req.body.name
    let price = req.body.price
    let quantity = req.body.quantity
    let categories = req.body.categories
    let description = req.body.description
    let photo = req.body.photo

    let item = new FoodItem("", vendorID, name, price, quantity, categories, description, photo)
    let id = FoodItemDataAccessObject.create(item)
    res.json({
        key: id
    })
})
/**
 * put: /api/food-item/:id
 * :id l id ca food item mun sa
 * - header:
 * {
 *   "Content-Type": "application/json"
 * }
 * - data:
 * {
 *   vendorID,
 *   name,
 *   price,
 *   quantity,
 *   categories,
 *   description,
 *   photo
 * }
 *
 * Nu tm thy id trng khp th sa cc li food item  v tr v:
 * {
 *   status: true
 * }
 * Nu khng th tr v:
 * {
 *   status: false
 * }
 */
router.put('/food-item/:id', async (req, res) => {
    let id = req.params.id
    let vendorID = req.body.vendorID
    let name = req.body.name
    let price = req.body.price
    let quantity = req.body.quantity
    let categories = req.body.categories
    let description = req.body.description
    let photo = req.body.photo

    let item = new FoodItem(id, vendorID, name, price, quantity, categories, description, photo)
    let status = await FoodItemDataAccessObject.modify(item)
    res.json({
        status: status
    })
})
/**
 * delete: /api/food-item/:id
 * :id l id ca food item mun xa
 * Nu id trng khp th s xa food item  v tr v:
 * {
 *   status: true
 * }
 * nu khng th tr v:
 * {
 *   status: false
 * }
 */
router.delete('/food-item/:id', async (req, res) => {
    let id = req.params.id
    let status = await FoodItemDataAccessObject.remove(id)
    res.json({
        status: status
    })
})
/* end food-item */

/* vendor-owner */

/* end vendor-owner */

/* customer */
import Customer from './customer/model'
import CustomerDataAccessObject from './customer/data-access-object'
/**
 * get: /api/customter/:username/:password
 * :username, :password ln lc l username v password ca customer
 * D liu tr v:
 * - Nu username v password trng khp th s tr v dng sau
 * {
 *   id,
 *   info: {
 *     username,
 *     firstname,
 *     lastname,
 *     email
 *   }
 * }
 * - Nu username v password trng khp th tr v null
 */
router.get('/customer/:username/:password', async (req, res) => {
    let username = req.params.username
    let password = req.params.password
    res.json(await CustomerDataAccessObject.queryByUsernamePassword(username, password))
})
/**
 * get: /api/customter/:id
 * :id l id ca customer
 * - Nu id trng khp th s tr v:
 * {
 *   id,
 *   info: {
 *     username,
 *     firstname,
 *     lastname,
 *     email
 *   }
 * }
 * - Nu id khng trng khp vi bt c d liu no th tr v null
 */
router.get('/customer/:id', async (req, res) => {
    let id = req.params.id
    res.json(await CustomerDataAccessObject.queryByID(id))
})

/**
 * post: /api/customer
 * - headers: 
 * {
 *   "Content-Type": "application/json"
 * }
 * - data:
 * {
 *   username,
 *   password,
 *   firstname,
 *   lastname,
 *   email
 * }
 * D liu tr v:
 * {
 *   id
 * }
 * Nu mt customer  tn ti username  th s tr v:
 * {
 *   id: null
 * }
 * Nu khng c customer no c cng username th s to mt ti khon customer mi v tr v id ca ti khon mi .
 */
router.post('/customer', async (req, res) => {
    let username = req.body.username
    let password = req.body.password
    let firstname = req.body.firstname
    let lastname = req.body.lastname
    let email = req.body.email
    let customer = new Customer("", username, password, firstname, lastname, email)
    res.json({
        id: await CustomerDataAccessObject.create(customer)
    })
})
/**
 * put: /customer/:username/:password
 * - headers:
 * {
 *   "Content-Type": "application/json"
 * }
 * - data: 
 * {
 *   password,
 *   firstname,
 *   lastname,
 *   email
 * }
 * 
 * Nu username v password khng ng th s tr v:
 * {
 *   status: false
 * }
 * Nu username v password ng th s sa password, firstname, lastname, email nh trong data v 
 */
router.put('/customer/:username/:password', async (req, res) => {
    let username = req.params.username
    let password = req.params.password
    let newPassword = req.body.password
    let newFirstname = req.body.firstname
    let newLastname = req.body.lastname
    let newEmail = req.body.email
    let info = await CustomerDataAccessObject.queryByUsernamePassword(username, password)
    if (info !== null) {
        let customer = new Customer(info.id, username, newPassword, newFirstname, newLastname, newEmail)
        CustomerDataAccessObject.modify(customer)
        res.json({
            status: true
        })
    } else {
        res.json({
            status: false
        })
    }
})
/* end customer */


/* order  */
import CartItem from './order/cart-item/model'
import Order from './order/model'
import OrderController from './order/controller'


/* end order */

export default router

